import "./App.css";
import { useState } from "react";

function App() {

  const d = new Date();
  const hr = d.getHours();

  const [count, setCount] = useState( hr );

  function inc() {
    setCount(count + 10);
  }
  return (
    <div className="App">


      <h1>{count}</h1>
      <button onClick={inc}>Click me</button>


    </div>
  );
}

export default App;
